        PlayerSearchComponent.prototype.isValidPlayerId = function (playerId) {
            return playerId.length > 0 && playerId.length <= 9 && !isNaN(playerId) && parseInt(playerId, 10) > 0
                && Number.isInteger(parseInt(playerId, 10));
        };
        PlayerSearchComponent.prototype.isValidCardId = function (cardValue) {
            var isValidCard;
            if (cardValue.match(/[a-z]/i)) {
                isValidCard = false;
            }
            else {
                var strLen = cardValue.length;
                if (cardValue[0] === ';' && cardValue[strLen - 1] === '?') {
                    var cardVal = cardValue.replace(';', '').replace('?', '');
                    cardVal = cardVal.replace(/[&\/\\#,+()$~%.'":*?<>{}=]/g, '');
                    if (!isNaN(cardVal)) {
                        isValidCard = true;
                    }
                    else {
                        isValidCard = false;
                    }
                }
                else {
                    isValidCard = false;
                }
            }
            return isValidCard;
        };
        PlayerSearchComponent.prototype.onKeyPressSearchText = function (event) {
            if (event.target.value.length > 8) {
                event.preventDefault();
            }
        };
        ;
        return PlayerSearchComponent;
